import { shoes } from "./Items";

const Home=()=>{

    const boxstyle={
        minWidth:'300px',
        minHeight:'300px',
        marginRight:'10px'
    }

    return(
        <>
            <div className="container">
                <div className="d-flex flex-row overflow-auto flex-nowrap">
                    {
                        shoes.map((data)=>(
                            <div className="card" style={boxstyle}>
                                <img className="card-img"/>
                            </div>
                        ))
                    }
                </div>
            </div>
        </>
    )
}

export default Home;
